import { Typography } from '@material-ui/core';
import { makeStyles } from '@material-ui/core/styles';
import LocalCafeTwoToneIcon from '@material-ui/icons/LocalCafeTwoTone';
import Toolbar from '@material-ui/core/Toolbar';

const useStyles = makeStyles((theme) => ({
    text: {
        //backgroundColor: "yellow", 
        width: '100%'
    },
    Toolbar:{
        backgroundColor: theme.pallete.background.paper, 
    },
  }));

export default function FooterBar() {
    const classes = useStyles();

    return(
        <Toolbar clas>
            <Typography variant="caption" align="center" className={classes.text}>
            Desenvolvido com <LocalCafeTwoToneIcon fontSize='small' /> por <a href="gabriel.souza89@fatec.sp.gov.br	"> Gabriel Desenvolvedor</a>
            </Typography>
        </Toolbar>
    )

}
